-- ----------------------------
-- Table structure for app_cluster
-- ----------------------------
DROP TABLE IF EXISTS `app_cluster`;
CREATE TABLE `app_cluster` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dept_id` int(11) NOT NULL COMMENT '应用所属部门ID',
  `name` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '应用名称',
  `type` int(11) DEFAULT NULL COMMENT '类型:1类似sso这种app,2,类似agent这种应用,,,ci发布时,过滤掉type=2(不带端口的进程,如agent)',
  `enable` int(1) NOT NULL DEFAULT '1' COMMENT '启用状态（0:禁止/1:启用）',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_by` int(11) NOT NULL,
  `create_date` datetime NOT NULL,
  `update_by` int(11) NOT NULL,
  `update_date` datetime NOT NULL,
  `del_flag` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `dept_id` (`dept_id`),
  KEY `update_by` (`update_by`),
  KEY `create_by` (`create_by`),
  CONSTRAINT `app_cluster_ibfk_1` FOREIGN KEY (`dept_id`) REFERENCES `sys_department` (`id`),
  CONSTRAINT `app_cluster_ibfk_2` FOREIGN KEY (`update_by`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `app_cluster_ibfk_3` FOREIGN KEY (`create_by`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=80 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='应用分组（集群）信息表';

