DROP TABLE IF EXISTS `app_host`;
CREATE TABLE `app_host` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '显示名称',
  `hostname` varchar(255) DEFAULT NULL COMMENT '操作系统主机名',
  `idc_id` int(11) DEFAULT NULL COMMENT '机房id',
  `status` int(1) DEFAULT NULL COMMENT '主机状态（如：新建/启动中/运行中/停止中/停止/挂起）',
  `create_date` datetime DEFAULT NULL,
  `create_by` varchar(255) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
