  `del_flag` int(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `idc_id` (`idc_id`),
  CONSTRAINT `app_host_ibfk_1` FOREIGN KEY (`idc_id`) REFERENCES `app_idc` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='(宿)主机信息表';

