-- Table structure for app_host_netcard
-- ----------------------------
DROP TABLE IF EXISTS `app_host_netcard`;
CREATE TABLE `app_host_netcard` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `host_id` int(11) NOT NULL,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '网卡名称',
  `status` varchar(16) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '网卡状态，如：UP/DOWN',
  `ipv4` varchar(15) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `ipv6` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `hwaddr` varchar(17) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '硬件Mac地址',
  `netmask` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '子网掩码',
  `broadcast` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '广播地址',
  `getway` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '网关地址',
  `create_date` datetime DEFAULT NULL,
  `create_by` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `update_by` datetime DEFAULT NULL,
  `del_flag` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `host_id` (`host_id`),
  CONSTRAINT `app_host_netcard_ibfk_1` FOREIGN KEY (`host_id`) REFERENCES `app_host` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='(宿)主机网卡信息表';

