  KEY `create_by` (`create_by`),
  CONSTRAINT `scm_version_ibfk_1` FOREIGN KEY (`create_by`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=426 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='ACM配置历史版本表';

