-- ----------------------------
-- Table structure for umc_alarm_template
-- ----------------------------
DROP TABLE IF EXISTS `umc_alarm_template`;
CREATE TABLE `umc_alarm_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '模板名称',
  `metric_id` int(11) DEFAULT NULL COMMENT '度量id',
  `tags` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '标签，如采集上行附加信息(ip=10.0.0.160, kafkaTopic=abc)',
  `notify_level` int(11) DEFAULT NULL COMMENT '高于此等级才告警',
  `enable` int(11) DEFAULT NULL COMMENT '启用状态',
  `remark` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='umc告警模版表';

