  `id` int(11) NOT NULL AUTO_INCREMENT,
  `metric` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '度量(e.g Host.mem.free)',
  `classify` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '度量类别,用字典key',
